import Landing from './pages/landing';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<div>Dashboard</div>}/>
        <Landing /> 
      </Routes>
    </BrowserRouter>
  );
}

export default App;
